import React from 'react'
import './style.css'
import data from '../00_practice/data'

const Accordian = () => {
  return (
    <div className='wrapper'>

        <div className='accordian'>
        {
            data ?
            data.map((item)=>
            <div className='title'>
                <h3>{item.question}</h3>
                <span>+</span>
            </div>
            )
            :null
        }
        </div>
    </div>
  )
}

export default Accordian;
